import React from 'react'
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper,
    TextField
} from '@mui/material';

const Form = () => {
    return (
        <Paper variant='outlined'>
            <Grid2 container component='form' direction='column' spacing={2}>
                <TextField name='positive' label='Positive Prompt' />
            </Grid2>
        </Paper>
    )
}

export default Form
